import React from 'react';
import RingImage from "../styles/bt.png";
import Detail from "../styles/detail.png";
import { Container, SignupFormContainer, Title } from "../styles/SignupStyle";



const Exercise = () => {
  // 운동량 데이터를 가져오는 함수
  //const fetchExerciseData = () => {
    // 데이터를 가져오는 로직
    // AsyncStorage 또는 외부 API를 사용
 // };
  const tabImageStyle = {
    width: '80%',
    height: '80%',
    margin: '7px'
  };

const handleRingImageClick = () => {
    window.location.href = "./ring";
  };

const dimage = {
    width: '20px',
    height: '20px',
    margin: '5px'
  };

const dimageClick = () => {
    window.location.href = "./ring";
  };



  return (
    <Container>
      <SignupFormContainer>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <Title>안녕하세요, OOO님의 오늘의 목표 활동량은 0%입니다.</Title>
          <img
            src={Detail}
            alt="detail"
            style={dimage}
            onClick={dimageClick}
          />
        </div>

        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img
            src={RingImage}
            alt="Ring"
            style={tabImageStyle}
            onClick={handleRingImageClick}
          />
        </div>
      </SignupFormContainer>
    </Container>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
});

export default Exercise;
